export function getTechIcon(name: string, properties: MaterialIconsProperties): UIComponent {
    
    properties.svg = TECH_ICONS[name] || "";
    let text : string = createSVG(properties);
    const icon = new UIComponent({
        type: "div",
        classes: ["icon", "box-center"],
        text: text,
    });
    
    return icon;
}